import React from 'react'
import { Link } from 'react-router-dom'

export const Home = () => {

  let user = localStorage.user;

  return (
    <div className="home">
      {
        !user
        ?
        <span>Dang nhap de xem thong tin ca nhan. <Link to="/dang-nhap">Dang nhap</Link></span>
        :
        <h2><Link to="/thong-tin-ca-nhan">Thong tin cua toi</Link></h2>
      }
    </div>
  )
}
